    <Navbar>
      <Container>
        <LinkContainer to={'/'}>
          <i className="fas fa-home" />
        </LinkContainer>
        
        <Navbar.Collapse className="justify-content-end">
          <Navbar.Text>
            Signed in as: <a href="#login">Mark Otto</a>
          </Navbar.Text>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
export default NavBar;
